import axios from "axios";
import { useEffect, useState } from "react";

interface User {
	id: number,
	email: string,
	firstName?: string,
	lastName?: string,
	userName?: string,
}

function GetAllUsers(): User[] {

	const users: Array<User> = [];

	axios.get('http://localhost:3001/user')
	.then(response => {
		response.data.forEach((element: User) => {
			users.push(element);
		});
	});
	return users;
}

const App:React.FC = () =>
{
	// const users: User[] = GetAllUsers();

	useEffect()

	const [users, setUsers] = useState<User[]>([]);
	setUsers(() => GetAllUsers());
	// console.log(users);

	return (
		<div> 
			<h1>These are all the Users!</h1>
			{users.map((element: User) => {
				return (<p>{element ? element.email : ""}</p>);
			})}
		</div>
		);
}

export default App;
